INSERT INTO `node_revisions` VALUES(109, 109, 1, 'Zootoca vivipara', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Viviparous Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Small, almost unflattened lizard. Small round head, short legs. Body length 4-7 cm. Females longer than males. Original tail 1.4-2 times the body length. (A regenerated tail is shorter and less colourful than the original one). Collar serrated, back scales keeled. Back and flanks brown or greyish brown, sometimes with a green or bronze shine. Flanks darker than back. On the border between back and flanks, there is a whitish or yellowish streak or series of spots. In females these streaks are more pronounced, in males they are more often broken into a series of spots or small stripes. Often dark and/or light spots are visible on back and flanks. In females, there is usually a dark streak or series of spots over the middle of the back, but in males, this streak can be absent. In males the belly is dark yellow to orange red with many black spots; in females the belly is whitish yellow or pale orange with a few small dark spots. Males have a relatively much bigger head than females, longer hind legs and a longer tail. Young animals usually are very dark bronze brown. Their belly is greyish black and the tail is very dark. Subadult animals look like females.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs in a large part of Europe and is widely distributed in Britain and Ireland.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> Mainly sandy areas like heaths, but also on moorland and in open woodlands. Prefers rather dense vegetation and a moist atmosphere. Common Lizards are widely distributed in the UK. You may find one almost anywhere from gardens, heath land, wooded glades, disused railway tracks and open meadows to the banks of ditches and along hedgerows. In the south of its range, it also occurs in the mountains- in the Alps up to altitudes of 3000 metres, and in the Pyrenees up to 2400 metres.  </FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from the end of March until October, depending on weather conditions. In spring, males appear earlier than females. Breeding activity takes place in April and May. This species is ovoviviparous, but in some areas in the south of its range, they lay eggs. In England, the young are born after 10 weeks, usually at the end of July or the beginning of August. Viviparous Lizards feed on all kinds of invertebrates, such as spiders and insects. They are good swimmers and sometimes flee in the water. They hibernate between the roots of plants and trees, in abandoned holes of other animals, beneath tree trunks etc. Young animals usually go into hibernation a little later than adults. Hibernation occurs from October to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be seen from March until the beginning of October. From mid-April until the end of May, most breeding activity takes place and they can then be seen most easily. During this time, the males and females bask in the open to absorb heat from the sun. Later in summer, it is usually only the pregnant females that are seen to bask. They will often use a stone, log or grass tussock close to cover for basking. If disturbed, they often return to their favourite spot soon afterwards. Young animals can be found from the end of July and sometimes stay active until the end of October.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Viviparous Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Small, almost unflattened lizard. Small round head, short legs. Body length 4-7 cm. Females longer than males. Original tail 1.4-2 times the body length.', '', 1247150147, 1);
INSERT INTO `node_revisions` VALUES(111, 111, 1, 'Podarcis muralis', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Common Wall Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Flattened, slender lizard. Body length up to 7 cm, usually smaller. Original tail 1.7 to more than 2 times the body length. (A regenerated tail is shorter and less colourful than the original one). Long legs and toes. The collar is not serrated and the scales are scarcely keeled. Back usually mid to dark greyish brown. Over the middle of the back, there is often a dark stripe, mainly in females. In many individuals, this stripe occurs as a row of spots. Females often have two pale dorsolateral streaks, with a dark band between them. Adult males have a chequered pattern of blotches on the flanks, and sometimes this pattern is reticulated. In females, the belly is usually light coloured, whitish or yellowish orange, with some small dark spots. In males, the colour of the belly is more intense, more orange red, with many larger black spots. Males have a relatively much larger head and longer hind legs and more often blue spots on the borders of the ventral scales. Newborn young are dark brown to black but soon they become lighter, more rusty brown.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs in a large part of Europe. In the British Isles, the subspecies Podarcis muralis brogniardi occurs on Jersey. The Common Wall Lizard has been introduced to the Isle of Wight, East Sussex, Dorset, Devon, Surrey and south-east London. Most of these colonies are of the typical form of this species, the subspecies P. m. muralis. Some are of the north-west Italian subspecies P. m. nigriventris. These have a green back, heavily marked with black spots or stripes and a heavily black-spotted belly (especially in males). </FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> Sunny walls or south facing rocky situations in which sufficient hiding places are present and surrounded by rather rough vegetation to forage. In the south of its range, it occurs in a variety of habitats. Often occurs in mountainous areas up to altitudes of 2300 metres, in the Pyrenees up to 2700 metres.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from March to October, depending on weather conditions. On very sunny and warm days, individuals are sometimes active in February or even January. The breeding season is from the end of March until mid-June. The males have a territory at this time and defend this very aggressively. In this period, you can often see the animals basking in pairs. Eggs are laid in May or June in loose humid soil in sunny spots, often in holes in a wall or under stones. Young can be born from July to September. Newly born young have a body length of about 2-2.5 cm. The young often migrate to new suitable habitats. Common Wall Lizards are very fast and climb very well. Large numbers can occur in favoured spots. They feed on all kinds of invertebrates, like spiders and insects. They hibernate in crevices in walls and in holes, often abandoned ones of other animals like mice. Hibernation is from October to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be seen from March to October. The best time is from April to June. Most breeding activity takes place in this period, so the animals are very active. The best chance is on sunny days in the morning or afternoon. In bad weather conditions and on very hot days, the animals retreat into their shelters.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Common Wall Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Flattened, slender lizard. Body length up to 7 cm, usually smaller. Original tail 1.7 to more than 2 times the body length.', '', 1247151555, 1);
INSERT INTO `node_revisions` VALUES(110, 110, 1, 'Lacerta agilis', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Sand Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Firm, stocky lizard with relatively short legs and tail. Not flattened. Body length up to about 9.5 cm, rarely larger. Original tail 1.3-1.7 times the body length. (A regenerated tail is shorter and less colourful than the original one). Head is short and deep (especially in males). Collar strongly serrated. Along the mid-back is a band of 8-16 scales, in which the scales are clearly narrowed and more keeled than the ones on each side of this band. Scales on the flanks are not keeled. Males are a little shorter than females but have a much bigger head and a relatively longer tail. In males the flanks and forelegs are bright green in spring (head, back, hind legs and tail usually stay brown). Females and subadult animals are brown or greyish brown. In most animals there&apos;s a light streak over the centre of the back, often broken up. There is also a light streak or series of spots on the sides of the back, which becomes continuous at the tail. Between these lines are multiple rows of dark spots. On the flanks there is a row of light spots surrounded by dark ones, sometimes merged together into streaks. In males the belly is light green, in females and young animals cream or yellow. In males the belly has many dark spots, while there are few in females and sometimes the spots are completely absent. Some specimens show a different pattern, such as males with an almost entirely green back or animals with a reddish or uniform brown-coloured back, without blotches. Young animals often have yellowish or whitish ocelli, bordered with dark brown on their flanks (sometimes also on the back). They often have a light streak on both sides of the back, and the tail is light-coloured. Subadult animals look like females.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs in a large part of Europe. Extremely rare in the British Isles, confined to a handful of sites in the UK. A very restricted distribution in southern England in Dorset and Surrey; also in north-west England in coastal Merseyside. In some places in the UK it is extinct now, although in some of these it has been reintroduced, including the West Country, West Sussex, Wales and Scotland. Not found in Ireland.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> All the sites that this lizard occupies in the UK are on sandy heath land or adjacent to heath land. In the south of its range it occupies more varied habitats. Also in the mountains, in the Pyrenees up to altitudes of 2200 metres.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from the end of March until October, depending on weather conditions. Most animals emerge from hibernation in April, the males first. At the end of April, breeding starts and continues until June. From June onwards, eggs are laid in open sandy places that are well exposed to the sun, and they are incubated by its warmth. Depending on the average summer temperatures, the young hatch between July and the beginning of October. Most hatch around the end of August/ beginning of September. The adult animals usually stay in their area, while young animals often migrate to new suitable habitats. The animals feed on all kinds of invertebrates such as spiders and insects. They hibernate in holes dug by themselves or abandoned ones from other animals such as mice. Hibernation is from mid-September to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be seen from March to October. Breeding takes place in May and the beginning of June, and the animals can be observed most readily then. Adult animals are active from March until the end of September, while young animals in good weather conditions stay active until November.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Sand Lizard</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Firm, stocky lizard with relatively short legs and tail. Not flattened. Body length up to about 9.5 cm, rarely larger.', '', 1247150173, 1);
INSERT INTO `node_revisions` VALUES(112, 112, 1, 'Anguis fragilis', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Slow Worm</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A long-bodied legless lizard, it looks more like a snake but it has much smaller scales than most snakes and also has movable eyelids. Due to its stiff scaling, it moves far less flexibly than a snake. Length usually up to 50 cm, about half of it consisting of the tail. (A regenerated tail is shorter and less colourful than the original one. In Slow Worms broken tails regenerate only slightly). The body is round and shiny with a small head. The back is brown, bronze, gold or greyish. Females usually have a dark dorsal stripe and very dark flanks and belly. Males are more uniform in colour and sometimes have small blue spots on the front part of the back and flanks; usually the belly is grey. Newborn animals are gold or silver coloured with a black dorsal stripe and they are very shiny. Their flanks are very dark, the belly is black. They are 7-10 cm long. </FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs in a large part of Europe and is widely distributed in the British Isles. Also found on Jersey, Guernsey, Herm and Alderney. One small introduction in Ireland, on the Burren in County Clare.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> Prefers warm, sheltered, half-open areas with rather moist soil, such as the edges of woods, glades in woods, rough heaths, pastures, and motorway and railway embankments. They also may be seen in churchyards, and on waste ground and allotments. They often live in gardens unnoticed, making use of compost heaps for their burrows and feeding on slugs and snails. In the south of Europe, also found in the mountains up to altitudes of 2400 metres.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from the end of March until October, depending on weather conditions. Diurnal or crepuscular, but spends most of the day hidden amongst vegetation, beneath stones or in holes in the ground. Moves rather stiffly, but can be quick when it is well-heated, especially in dense vegetation. Males emerge from hibernation in March, females and young animals in April. Most breeding activities take place in May. The Slow Worm is ovoviviparous, and the female gives birth to up to 20 young, mainly in August or September in the UK. In the more southern countries of its range, young are produced annually, but in the UK only once every two years. Slow Worms feed on small invertebrates and prefer soft prey like slugs, snails and earthworms. They hibernate underground, in tunnels dug by themselves or in abandoned holes of other animals. Hibernation occurs from October to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0">How to find: These animals can be seen from March until October. The best chance to see them is early in the morning or late in the afternoon. They can be seen basking, usually in small patches of sunlight among vegetation, sometimes on a flat stone or on (cycle) paths. A good opportunity is when rain is falling after a dry, warm period. Just after rain, the animals go searching for food. In August, the gravid females bask frequently, also in the afternoon.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Slow Worm</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A long-bodied legless lizard, it looks more like a snake but it has much smaller scales than most snakes and also has movable eyelids.', '', 1247150857, 1);
INSERT INTO `node_revisions` VALUES(113, 113, 1, 'Natrix natrix', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Grass Snake</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Large snake, males usually 60-80 cm, females 80-120 cm. The head is clearly separated from the body. They have round pupils. Usually there is a distinct yellow or whitish collar behind the head. On the posterior edge, this collar is bordered by black markings. In young animals, the ring is distinct, but in older animals it starts fading. The back scales are strongly keeled. The colour on the back varies from grey to olive green with small dark spots. Also, there are spots on the flanks, where they often merge into dark vertical bars. The belly is whitish or yellowish, chequered with black. Sexes difficult to distinguish. Females are often bigger, males have a broader tail. Newborn Grass Snakes are 15-20 cm in length, mostly grey and the collar is richer in contrast than in adult animals. Southeast European individuals (of the subspecies N. n. persa) were introduced to a small area of Surrey and their genes may persist in the local population as characteristic striped individuals have been seen.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs almost all over Europe. Common in England and Wales. Also found on Jersey. (The animals here tend to be fairly uniform, often without a distinct, pale collar.) Not found in Ireland or Scotland. </FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> Prefers well overgrown rough areas usually close to a standing body of water. Mostly found on shore/ bank areas of lakes, pools, rivers and canals, in reed borders or other vegetation. Can also be encountered further away from water on the edges of woods or heaths. Individuals can migrate over long distances and so can colonise new areas. In the more southern part of its range, it also occurs in mountains up to altitudes of 2400 metres.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from mid-March until October, depending on weather conditions. The males appear first, then the females and finally the young. It is a diurnal water snake that occasionally can be found far away from water. Sometimes also crepuscular or active at night. A very good swimmer and diver. Most breeding activity takes place in April, but also in May and sometimes even in autumn. In April, they travel from their winter quarters to their summer habitat. In April, May and June, the females bask as much as possible to stimulate the development of the eggs, and then they may move kilometres away searching for a good place to lay their eggs. In warm summers, this happens as early as May. Depending on her size and condition, she will lay between 5 and 30 eggs, preferably in compost and dung heaps. Because of the fermentation processes, the temperature will be a little higher than in the surroundings and so will help to incubate the eggs. Particularly favourable places are used by several females, so that sometimes hundreds of eggs can be found in one heap. After 6-10 weeks, the young hatch, most of them in September. Grass Snakes live solitary and are not territorial. They feed on small vertebrates, mainly amphibians, but also small mammals, fish and lizards. Rather shy and not aggressive, Grass Snakes only show aggression if cornered, hissing loudly and coiling into a position that looks like they may strike. This is bluff, they rarely bite and if handled they often play dead. Hibernate in holes under ground, in compost and dung heaps or beneath leaf litter etc. from mid-October to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be seen from mid-March until October, often in water or close to it. In the breeding season, most activity takes place and the chance of encountering a Grass Snake is greatest. In the rest of the active period, these snakes are mainly seen early in the morning, when they warm themselves up in the sun. The Grass Snake is an occasional garden visitor.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Grass Snake</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> Large snake, males usually 60-80 cm, females 80-120 cm. The head is clearly separated from the body. They have round pupils.', '', 1247149412, 1);
INSERT INTO `node_revisions` VALUES(114, 114, 1, 'Coronella austriaca', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Smooth Snake</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A moderately small, cylindrical snake. Total length 50-80 cm. Head small with a poorly defined neck, small eyes with a round pupil. Back scales smooth, which gives the snake a shiny appearance. Colour and pattern variable. Back and flanks grey to brown, sometimes yellowish or reddish, with a pattern of paired dark spots. These spots are often merged into transverse bars, sometimes into two lines. On the posterior of the head there is a dark brown to black spot, a kind of crown. A brownish black stripe on each side of the head runs from the neck through the eye to the nostril. The colour of the belly varies from reddish brown to grey or black, generally with fine dark spotting. Females bigger than males. Newborn young are 12-20 cm long. They are darker than adult animals and usually have a brick-red belly.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Occurs over most of continental Europe, but with a very restricted distribution in southern England. Now thought to be confined to small areas in the south-east of Dorset, south-west Hampshire and a small area of east Hampshire and west Surrey. In other places, it is now extinct.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> This species is found on dry, sandy heath slopes with mature heather and Dwarf Gorse, usually south facing, but some locations near Poole are north slopes, with damp heath at the bottom of the slope. In the south of Europe, it is found mainly in the mountains up to altitudes of 2000 metres.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from the end of March until October, depending on weather conditions. But most animals don&apos;t emerge from hibernation before May. Between mid-April and the end of May, they migrate from their winter quarters to their summer habitat. This is a diurnal snake, but it avoids extreme heat and is mostly active in the cooler parts of the day, or in warm cloudy conditions or even at night during warm weather. Mating takes place in April, but also in autumn. Sometimes several gravid females are found together on good basking spots, especially in July and August, to stimulate the development of the eggs. They are ovoviviparous. In August and September, many males are seen. Most young are born between mid-August and mid-September. This varies, depending on the average summer temperatures. In England, the females breed only every two years. The home range in England may be around 0.5-3 hectares. For orientation and hunting, scent is more important than sight. They feed on small vertebrates, mainly lizards. The rest of the diet consists of small mammals, small snakes and nestling birds. Young snakes may eat insects as well. Moves rather slowly. They bite readily, but are non-venomous and totally harmless. They hibernate in holes under ground, from October until April, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be found from April until October. They can be seen most easily in spring or after the hot summer months. They avoid heat, and are active on cooler days or with misty rain. On hot days, they retreat underground.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Smooth Snake</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A moderately small, cylindrical snake. Total length 50-80 cm. Head small with a poorly defined neck, small eyes with a round pupil.', '', 1247151222, 1);
INSERT INTO `node_revisions` VALUES(115, 115, 1, 'Vipera berus', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Adder</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A thick-bodied snake. Length 50-80 cm. Mostly around 65 cm. They have a zigzag stripe on the back, a flattened head and a vertical pupil. Very short tail. The back scales are keeled. Back mostly brown to grey, sometimes more greenish, bluish, yellowish or reddish brown. Round points or spots on the flanks. Behind the head, there is a X- or V-shaped dark spot and from the eyes, there is a dark stripe over the side of the head. The tip of the tail is yellow or orange on the underside. Males often have a blackish brown zigzag stripe on a pale grey or grey-beige background, belly mostly black. Females more often with a brown zigzag stripe on a yellowish to reddish brown background, belly mostly brownish. Males have more contrast, so the zigzag stripe is more obvious in them. Also dark to totally black animals occur in which the zigzag stripe is hardly visible. Males are slimmer and smaller than females, have a comparatively longer tail and a thickened base of the tail. Newborn young are 14-18 cm long and look like adult animals.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Range:</B> Mid and northern Europe, also the north of Italy. The Adder has a widespread distribution throughout the UK. Not in Ireland.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habitat:</B> Favours rather moist places like moors and moist heaths. Usually associated with open heath land, it also occurs in woodland, in particular in open areas within wooded regions where sunny patches occur. The Adder is the UK&apos;s only native venomous snake. In the south of Europe, it is more a mountain species, occurring up to altitudes of 3000 metres in the Alps.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Habits:</B> Active from the end of February until the beginning of October, depending on weather conditions. Males appear first. The breeding season is from mid-April to May. After this period, the Adders disperse over their summer habitat. In the summer months, mainly basking females are to be seen, to stimulate the development of the eggs. Adders are ovoviviparous. In England, an Adder female breeds only every two years. From mid-August, the animals start migrating towards their hibernation quarters. Sometimes these are far from their summer habitat. The young are born near these overwintering places, at the end of August or in September. Adders are diurnal, but on warm days they are also active around sunset. This snake is not aggressive, people are usually only bitten during attempts to catch or handle them. The bite is poisonous but rarely fatal. Feeds mainly on small vertebrates like mice and young birds, but also on lizards and frogs. Hibernates in holes between the roots of trees or beneath heaps of wood or stones, often together with others of its own sort or even with different animal species. Hibernation is from October to March, depending on weather conditions.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>How to find:</B> These animals can be found from the end of February until the beginning of October. In the morning, Adders warm themselves up in the sun. During the breeding season in April and May, the animals come together at favoured sites and are observed more easily than at other times. In the summer months, mainly basking females are seen. In autumn, the animals are found around their hibernation quarters. The Adder is not a common garden visitor, though occasionally if conditions suit them they will take up residence.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Adder</B></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"><B>Identification:</B> A thick-bodied snake. Length 50-80 cm. Mostly around 65 cm. They have a zigzag stripe on the back, a flattened head and a vertical pupil. Very short tail.', '', 1247149659, 1);
