INSERT INTO `search_dataset` VALUES(116, 'node', ' trachemys scripta elegans redeared terrapin identification  carapace flat and with a length up to 30 cm usually smaller with age the carapace becomes more and more elongated basic colour of carapace head and legs is olive to very dark green with a more or less distinct pattern of yellow stripes head neck and legs with yellow stripes and behind the eyes a large elongated red orange patch plastron is light yellow with a pattern of dark spots usually one spot on every scute with age the plastron gets darker and the spots faint so the contrast becomes less and less in very young animals the carapace is round and bright green with a pattern of yellow stripes and with ocelli on both the carapace and the plastron at the sides the carapace and plastron are joined together the carapace is somewhat serrated on the backside and is weakly keeled along the middle in young animals this keel is more distinctive but it fades with age webbing on front and hind legs front legs with 5 claws hind legs with 4 males are smaller than females and have much longer curved claws similar sub species that also can be found in the british isles cumberland turtle trachemys scripta troostii this subspecies doesn t have a red patch on the head yellowbellied slider trachemys scripta scripta similar to the other two subspecies it has only yellow markings on the head can be distinguished from the cumberland turtle by having a yellow vertical band behind the eye onto which some yellow horizontal bands join besides that the carapace is more rounded range  originates from the us mississippi drainage large numbers of young specimens have been imported all over europe as pets and many of them have been released or escaped thus it is now regularly encountered in the wild in the british isles it has been introduced into several localities including canals in the london region it can survive here but is not able to breed so far in the south of europe it is able to reproduce because of the higher temperatures habitat  all kinds of still or slowrunning waters preferably with dense vegetation frequently found in water in the surroundings of people like ponds in parks and canals because it is released there the most habits  restricted to fresh water leaves the water only to bask or to lay eggs it can live in many different type or size of water body thanks to this it manages to survive in britain but it is not easy for them the climate is not ideal the winters are not the problem because then they go in hibernation the problem is that the summer is too short and autumn and spring too long the temperatures in these periods are too high to go into hibernation but too low to let their metabolism function well only in the south of europe does it manage to reproduce successfully due to its aggressive behaviour it there can be a threat to the native terrapins the female lays about 512 eggs that are placed in a hole that she digs with her hind legs on land the carapace of newborn young is 235 cm long they are not thought to be breeding in the uk as the mean summer temperature is too low they are very longlived and if exceptional hot summers occasionally permit breeding and successful hatching of the eggs they might persist without further introductions in general this species is quite shy and it quickly dives under water when disturbed feeds mainly on animal matter but besides that they eat vegetable matter as well hibernates in the mud under water but sometimes dug into the soil on land as well the import of these animals has been forbidden for more then 10 years but other species or subspecies have been imported since then now these animals are also encountered in the wild how to find likes to bask on objects rising above the water like stones or logs or on the borders of the water but quickly dives under when approached the best chance of seeing them is to observe the water on a sunny day from a distance  trachemys scripta elegans  ', 0);
