INSERT INTO `search_dataset` VALUES(111, 'node', ' podarcis muralis common wall lizard identification  flattened slender lizard body length up to 7 cm usually smaller original tail 17 to more than 2 times the body length a regenerated tail is shorter and less colourful than the original one long legs and toes the collar is not serrated and the scales are scarcely keeled back usually mid to dark greyish brown over the middle of the back there is often a dark stripe mainly in females in many individuals this stripe occurs as a row of spots females often have two pale dorsolateral streaks with a dark band between them adult males have a chequered pattern of blotches on the flanks and sometimes this pattern is reticulated in females the belly is usually light coloured whitish or yellowish orange with some small dark spots in males the colour of the belly is more intense more orange red with many larger black spots males have a relatively much larger head and longer hind legs and more often blue spots on the borders of the ventral scales newborn young are dark brown to black but soon they become lighter more rusty brown range  occurs in a large part of europe in the british isles the subspecies podarcis muralis brogniardi occurs on jersey the common wall lizard has been introduced to the isle of wight east sussex dorset devon surrey and southeast london most of these colonies are of the typical form of this species the subspecies p m muralis some are of the northwest italian subspecies p m nigriventris these have a green back heavily marked with black spots or stripes and a heavily blackspotted belly especially in males  habitat  sunny walls or south facing rocky situations in which sufficient hiding places are present and surrounded by rather rough vegetation to forage in the south of its range it occurs in a variety of habitats often occurs in mountainous areas up to altitudes of 2300 metres in the pyrenees up to 2700 metres habits  active from march to october depending on weather conditions on very sunny and warm days individuals are sometimes active in february or even january the breeding season is from the end of march until midjune the males have a territory at this time and defend this very aggressively in this period you can often see the animals basking in pairs eggs are laid in may or june in loose humid soil in sunny spots often in holes in a wall or under stones young can be born from july to september newly born young have a body length of about 225 cm the young often migrate to new suitable habitats common wall lizards are very fast and climb very well large numbers can occur in favoured spots they feed on all kinds of invertebrates like spiders and insects they hibernate in crevices in walls and in holes often abandoned ones of other animals like mice hibernation is from october to march depending on weather conditions how to find  these animals can be seen from march to october the best time is from april to june most breeding activity takes place in this period so the animals are very active the best chance is on sunny days in the morning or afternoon in bad weather conditions and on very hot days the animals retreat into their shelters  podarcis muralis  ', 0);
INSERT INTO `search_dataset` VALUES(125, 'node', ' size 5 small and slender total length 15 cm 0 zootoca vivipara ', 0);
INSERT INTO `search_dataset` VALUES(109, 'node', ' zootoca vivipara viviparous lizard identification  small almost unflattened lizard small round head short legs body length 47 cm females longer than males original tail 142 times the body length a regenerated tail is shorter and less colourful than the original one collar serrated back scales keeled back and flanks brown or greyish brown sometimes with a green or bronze shine flanks darker than back on the border between back and flanks there is a whitish or yellowish streak or series of spots in females these streaks are more pronounced in males they are more often broken into a series of spots or small stripes often dark and or light spots are visible on back and flanks in females there is usually a dark streak or series of spots over the middle of the back but in males this streak can be absent in males the belly is dark yellow to orange red with many black spots in females the belly is whitish yellow or pale orange with a few small dark spots males have a relatively much bigger head than females longer hind legs and a longer tail young animals usually are very dark bronze brown their belly is greyish black and the tail is very dark subadult animals look like females range  occurs in a large part of europe and is widely distributed in britain and ireland habitat  mainly sandy areas like heaths but also on moorland and in open woodlands prefers rather dense vegetation and a moist atmosphere common lizards are widely distributed in the uk you may find one almost anywhere from gardens heath land wooded glades disused railway tracks and open meadows to the banks of ditches and along hedgerows in the south of its range it also occurs in the mountains in the alps up to altitudes of 3000 metres and in the pyrenees up to 2400 metres habits  active from the end of march until october depending on weather conditions in spring males appear earlier than females breeding activity takes place in april and may this species is ovoviviparous but in some areas in the south of its range they lay eggs in england the young are born after 10 weeks usually at the end of july or the beginning of august viviparous lizards feed on all kinds of invertebrates such as spiders and insects they are good swimmers and sometimes flee in the water they hibernate between the roots of plants and trees in abandoned holes of other animals beneath tree trunks etc young animals usually go into hibernation a little later than adults hibernation occurs from october to march depending on weather conditions how to find  these animals can be seen from march until the beginning of october from midapril until the end of may most breeding activity takes place and they can then be seen most easily during this time the males and females bask in the open to absorb heat from the sun later in summer it is usually only the pregnant females that are seen to bask they will often use a stone log or grass tussock close to cover for basking if disturbed they often return to their favourite spot soon afterwards young animals can be found from the end of july and sometimes stay active until the end of october  zootoca vivipara  ', 0);
INSERT INTO `search_dataset` VALUES(126, 'node', ' size 5 large and firm total length 20 cm 0 lacerta agilis ', 0);
INSERT INTO `search_dataset` VALUES(110, 'node', ' lacerta agilis sand lizard identification  firm stocky lizard with relatively short legs and tail not flattened body length up to about 95 cm rarely larger original tail 1317 times the body length a regenerated tail is shorter and less colourful than the original one head is short and deep especially in males collar strongly serrated along the midback is a band of 816 scales in which the scales are clearly narrowed and more keeled than the ones on each side of this band scales on the flanks are not keeled males are a little shorter than females but have a much bigger head and a relatively longer tail in males the flanks and forelegs are bright green in spring head back hind legs and tail usually stay brown females and subadult animals are brown or greyish brown in most animals there s a light streak over the centre of the back often broken up there is also a light streak or series of spots on the sides of the back which becomes continuous at the tail between these lines are multiple rows of dark spots on the flanks there is a row of light spots surrounded by dark ones sometimes merged together into streaks in males the belly is light green in females and young animals cream or yellow in males the belly has many dark spots while there are few in females and sometimes the spots are completely absent some specimens show a different pattern such as males with an almost entirely green back or animals with a reddish or uniform browncoloured back without blotches young animals often have yellowish or whitish ocelli bordered with dark brown on their flanks sometimes also on the back they often have a light streak on both sides of the back and the tail is lightcoloured subadult animals look like females range  occurs in a large part of europe extremely rare in the british isles confined to a handful of sites in the uk a very restricted distribution in southern england in dorset and surrey also in northwest england in coastal merseyside in some places in the uk it is extinct now although in some of these it has been reintroduced including the west country west sussex wales and scotland not found in ireland habitat  all the sites that this lizard occupies in the uk are on sandy heath land or adjacent to heath land in the south of its range it occupies more varied habitats also in the mountains in the pyrenees up to altitudes of 2200 metres habits  active from the end of march until october depending on weather conditions most animals emerge from hibernation in april the males first at the end of april breeding starts and continues until june from june onwards eggs are laid in open sandy places that are well exposed to the sun and they are incubated by its warmth depending on the average summer temperatures the young hatch between july and the beginning of october most hatch around the end of august beginning of september the adult animals usually stay in their area while young animals often migrate to new suitable habitats the animals feed on all kinds of invertebrates such as spiders and insects they hibernate in holes dug by themselves or abandoned ones from other animals such as mice hibernation is from midseptember to march depending on weather conditions how to find  these animals can be seen from march to october breeding takes place in may and the beginning of june and the animals can be observed most readily then adult animals are active from march until the end of september while young animals in good weather conditions stay active until november  lacerta agilis  ', 0);
INSERT INTO `search_dataset` VALUES(127, 'node', ' colour pattern 6 uniform or thin dark line along back 0 anguis fragilis ', 0);
INSERT INTO `search_dataset` VALUES(112, 'node', ' anguis fragilis slow worm identification  a longbodied legless lizard it looks more like a snake but it has much smaller scales than most snakes and also has movable eyelids due to its stiff scaling it moves far less flexibly than a snake length usually up to 50 cm about half of it consisting of the tail a regenerated tail is shorter and less colourful than the original one in slow worms broken tails regenerate only slightly the body is round and shiny with a small head the back is brown bronze gold or greyish females usually have a dark dorsal stripe and very dark flanks and belly males are more uniform in colour and sometimes have small blue spots on the front part of the back and flanks usually the belly is grey newborn animals are gold or silver coloured with a black dorsal stripe and they are very shiny their flanks are very dark the belly is black they are 710 cm long range  occurs in a large part of europe and is widely distributed in the british isles also found on jersey guernsey herm and alderney one small introduction in ireland on the burren in county clare habitat  prefers warm sheltered halfopen areas with rather moist soil such as the edges of woods glades in woods rough heaths pastures and motorway and railway embankments they also may be seen in churchyards and on waste ground and allotments they often live in gardens unnoticed making use of compost heaps for their burrows and feeding on slugs and snails in the south of europe also found in the mountains up to altitudes of 2400 metres habits  active from the end of march until october depending on weather conditions diurnal or crepuscular but spends most of the day hidden amongst vegetation beneath stones or in holes in the ground moves rather stiffly but can be quick when it is wellheated especially in dense vegetation males emerge from hibernation in march females and young animals in april most breeding activities take place in may the slow worm is ovoviviparous and the female gives birth to up to 20 young mainly in august or september in the uk in the more southern countries of its range young are produced annually but in the uk only once every two years slow worms feed on small invertebrates and prefer soft prey like slugs snails and earthworms they hibernate underground in tunnels dug by themselves or in abandoned holes of other animals hibernation occurs from october to march depending on weather conditions how to find these animals can be seen from march until october the best chance to see them is early in the morning or late in the afternoon they can be seen basking usually in small patches of sunlight among vegetation sometimes on a flat stone or on cycle paths a good opportunity is when rain is falling after a dry warm period just after rain the animals go searching for food in august the gravid females bask frequently also in the afternoon  anguis fragilis  ', 0);
INSERT INTO `search_dataset` VALUES(128, 'node', ' colour pattern 6 dark zigzag stripe on the back 0 vipera berus ', 0);
INSERT INTO `search_dataset` VALUES(115, 'node', ' vipera berus adder identification  a thickbodied snake length 5080 cm mostly around 65 cm they have a zigzag stripe on the back a flattened head and a vertical pupil very short tail the back scales are keeled back mostly brown to grey sometimes more greenish bluish yellowish or reddish brown round points or spots on the flanks behind the head there is a x or vshaped dark spot and from the eyes there is a dark stripe over the side of the head the tip of the tail is yellow or orange on the underside males often have a blackish brown zigzag stripe on a pale grey or greybeige background belly mostly black females more often with a brown zigzag stripe on a yellowish to reddish brown background belly mostly brownish males have more contrast so the zigzag stripe is more obvious in them also dark to totally black animals occur in which the zigzag stripe is hardly visible males are slimmer and smaller than females have a comparatively longer tail and a thickened base of the tail newborn young are 1418 cm long and look like adult animals range  mid and northern europe also the north of italy the adder has a widespread distribution throughout the uk not in ireland habitat  favours rather moist places like moors and moist heaths usually associated with open heath land it also occurs in woodland in particular in open areas within wooded regions where sunny patches occur the adder is the uk s only native venomous snake in the south of europe it is more a mountain species occurring up to altitudes of 3000 metres in the alps habits  active from the end of february until the beginning of october depending on weather conditions males appear first the breeding season is from midapril to may after this period the adders disperse over their summer habitat in the summer months mainly basking females are to be seen to stimulate the development of the eggs adders are ovoviviparous in england an adder female breeds only every two years from midaugust the animals start migrating towards their hibernation quarters sometimes these are far from their summer habitat the young are born near these overwintering places at the end of august or in september adders are diurnal but on warm days they are also active around sunset this snake is not aggressive people are usually only bitten during attempts to catch or handle them the bite is poisonous but rarely fatal feeds mainly on small vertebrates like mice and young birds but also on lizards and frogs hibernates in holes between the roots of trees or beneath heaps of wood or stones often together with others of its own sort or even with different animal species hibernation is from october to march depending on weather conditions how to find  these animals can be found from the end of february until the beginning of october in the morning adders warm themselves up in the sun during the breeding season in april and may the animals come together at favoured sites and are observed more easily than at other times in the summer months mainly basking females are seen in autumn the animals are found around their hibernation quarters the adder is not a common garden visitor though occasionally if conditions suit them they will take up residence  vipera berus  ', 0);
INSERT INTO `search_dataset` VALUES(129, 'node', ' colour pattern 6 yellowwhite collar behind head 0 natrix natrix ', 0);
INSERT INTO `search_dataset` VALUES(113, 'node', ' natrix natrix grass snake identification  large snake males usually 6080 cm females 80120 cm the head is clearly separated from the body they have round pupils usually there is a distinct yellow or whitish collar behind the head on the posterior edge this collar is bordered by black markings in young animals the ring is distinct but in older animals it starts fading the back scales are strongly keeled the colour on the back varies from grey to olive green with small dark spots also there are spots on the flanks where they often merge into dark vertical bars the belly is whitish or yellowish chequered with black sexes difficult to distinguish females are often bigger males have a broader tail newborn grass snakes are 1520 cm in length mostly grey and the collar is richer in contrast than in adult animals southeast european individuals of the subspecies n n persa were introduced to a small area of surrey and their genes may persist in the local population as characteristic striped individuals have been seen range  occurs almost all over europe common in england and wales also found on jersey the animals here tend to be fairly uniform often without a distinct pale collar not found in ireland or scotland habitat  prefers well overgrown rough areas usually close to a standing body of water mostly found on shore bank areas of lakes pools rivers and canals in reed borders or other vegetation can also be encountered further away from water on the edges of woods or heaths individuals can migrate over long distances and so can colonise new areas in the more southern part of its range it also occurs in mountains up to altitudes of 2400 metres habits  active from midmarch until october depending on weather conditions the males appear first then the females and finally the young it is a diurnal water snake that occasionally can be found far away from water sometimes also crepuscular or active at night a very good swimmer and diver most breeding activity takes place in april but also in may and sometimes even in autumn in april they travel from their winter quarters to their summer habitat in april may and june the females bask as much as possible to stimulate the development of the eggs and then they may move kilometres away searching for a good place to lay their eggs in warm summers this happens as early as may depending on her size and condition she will lay between 5 and 30 eggs preferably in compost and dung heaps because of the fermentation processes the temperature will be a little higher than in the surroundings and so will help to incubate the eggs particularly favourable places are used by several females so that sometimes hundreds of eggs can be found in one heap after 610 weeks the young hatch most of them in september grass snakes live solitary and are not territorial they feed on small vertebrates mainly amphibians but also small mammals fish and lizards rather shy and not aggressive grass snakes only show aggression if cornered hissing loudly and coiling into a position that looks like they may strike this is bluff they rarely bite and if handled they often play dead hibernate in holes under ground in compost and dung heaps or beneath leaf litter etc from midoctober to march depending on weather conditions how to find  these animals can be seen from midmarch until october often in water or close to it in the breeding season most activity takes place and the chance of encountering a grass snake is greatest in the rest of the active period these snakes are mainly seen early in the morning when they warm themselves up in the sun the grass snake is an occasional garden visitor  natrix natrix  ', 0);
INSERT INTO `search_dataset` VALUES(130, 'node', ' colour pattern 6 small paired dark spots on back 0 coronella austriaca ', 0);
INSERT INTO `search_dataset` VALUES(114, 'node', ' coronella austriaca smooth snake identification  a moderately small cylindrical snake total length 5080 cm head small with a poorly defined neck small eyes with a round pupil back scales smooth which gives the snake a shiny appearance colour and pattern variable back and flanks grey to brown sometimes yellowish or reddish with a pattern of paired dark spots these spots are often merged into transverse bars sometimes into two lines on the posterior of the head there is a dark brown to black spot a kind of crown a brownish black stripe on each side of the head runs from the neck through the eye to the nostril the colour of the belly varies from reddish brown to grey or black generally with fine dark spotting females bigger than males newborn young are 1220 cm long they are darker than adult animals and usually have a brickred belly range  occurs over most of continental europe but with a very restricted distribution in southern england now thought to be confined to small areas in the southeast of dorset southwest hampshire and a small area of east hampshire and west surrey in other places it is now extinct habitat  this species is found on dry sandy heath slopes with mature heather and dwarf gorse usually south facing but some locations near poole are north slopes with damp heath at the bottom of the slope in the south of europe it is found mainly in the mountains up to altitudes of 2000 metres habits  active from the end of march until october depending on weather conditions but most animals don t emerge from hibernation before may between midapril and the end of may they migrate from their winter quarters to their summer habitat this is a diurnal snake but it avoids extreme heat and is mostly active in the cooler parts of the day or in warm cloudy conditions or even at night during warm weather mating takes place in april but also in autumn sometimes several gravid females are found together on good basking spots especially in july and august to stimulate the development of the eggs they are ovoviviparous in august and september many males are seen most young are born between midaugust and midseptember this varies depending on the average summer temperatures in england the females breed only every two years the home range in england may be around 053 hectares for orientation and hunting scent is more important than sight they feed on small vertebrates mainly lizards the rest of the diet consists of small mammals small snakes and nestling birds young snakes may eat insects as well moves rather slowly they bite readily but are nonvenomous and totally harmless they hibernate in holes under ground from october until april depending on weather conditions how to find  these animals can be found from april until october they can be seen most easily in spring or after the hot summer months they avoid heat and are active on cooler days or with misty rain on hot days they retreat underground  coronella austriaca  ', 0);
